import React from 'react';

import Button from '../../UserInterface/Buttons/Button';

function Word (props){
    
    return(
        <div className="">
            <div>{ props.number}</div>
            <Button
                    name={props.word}
                    onclick={props.onclick}
                    data={props.number}
                />
        
        </div>
    )
}

export default Word
